import React, { Component } from 'react';

export default class Users extends Component {
 
    
  render() {
    
    return (
      <div className='w-25'>
        <h4>{this.props.kategorid}</h4>
        <div className="list">
          <ul>
          {
            this.props.kategori.map(kategori=> 
              <li className='pt-3' onClick={this.props.show}>{kategori.kategoryName }</li>
              )
          }
           </ul>
        </div>
      </div>
    );
  }
}
